import React from 'react';
import './Search-Panel.css';
import ItemStatusFilter from './item-status-filter';


const SearchPanel = () => {
    return (
        <div className>
            <input type="text" placeholder="search" className="search-input" />
            <ItemStatusFilter />
        </div>
    );
};


export default SearchPanel;
